interface Date {
    setYear(year: number): number;
    toFormattedString(format: string): string;
    fromFormattedString(value: string, format: string): Date;
}
interface DateConstructor {
    format(date: Date, format: string): string;
    parseFormatted(value: string, format: string): Date;
    formatLogic: {
        pad(value: string, digits: number): string;
        convertTo12Hour(value: number): number;
        i18n: any;
    };
    parseLogic: {
        unpad(value: string): string;
        parseInt(value: string): number;
    };
}
